import{_ as e,o,c as a,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 8.01-636 In what cases writ issued.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-636.md","filePath":"vacode/8.01-636.md"}'),i={name:"vacode/8.01-636.md"},n=t('<h1 id="§-8-01-636-in-what-cases-writ-issued" tabindex="-1">§ 8.01-636 In what cases writ issued. <a class="header-anchor" href="#§-8-01-636-in-what-cases-writ-issued" aria-label="Permalink to &quot;§ 8.01-636 In what cases writ issued.&quot;">​</a></h1><p>A writ of quo warranto may be issued and prosecuted in the name of the Commonwealth in any of the following cases:</p><ol><li><p>Against a domestic corporation, other than a municipal corporation, for the misuse or nonuse of its corporate privileges and franchises, or for the exercise of a privilege or franchise not conferred upon it by law, or when a charter of incorporation has been obtained by it for a fraudulent purpose, or for a purpose not authorized by law;</p></li><li><p>Against a person for the misuse or nonuse of any privilege conferred upon him by law;</p></li></ol><p>2a. Against a person engaged in the practice of any profession without being duly authorized or licensed to do so;</p><ol start="3"><li><p>Against any person or persons acting as a corporation, other than a municipal corporation, without authority of law; and</p></li><li><p>Against any person who intrudes into or usurps any public office. But no writ shall be issued or prosecuted against any person now in office for any cause which would have been available in support of a proceeding to contest his election.</p></li></ol><p>Provided that nothing herein shall be construed to give jurisdiction to any court to judge the election, qualifications, or returns of the members of either house of the General Assembly.</p><p>Code 1950, § 8-857; 1977, c. 617; 1980, c. 705.</p>',7),r=[n];function s(c,p,h,l,d,u){return o(),a("div",null,r)}const w=e(i,[["render",s]]);exp